#[inline(always)]
pub fn apply_sbox<AB>(
    state: [AB::Expr; 12],
) -> [AB::Expr; 12]
where
    AB: MidenAirBuilder,
{
    state.map(|s| {
        let s2 = s.square();
        let s4 = s2.square();
        s * s4 * s2
    })
}

use crate::trace::chiplets::hasher::Hasher;

#[inline(always)]
pub fn apply_mds<AB>(
    state: [AB::Expr; 12],
) -> [AB::Expr; 12]
where
    AB: MidenAirBuilder,
{
    let mut result = [AB::Expr::ZERO; 12];
    result.iter_mut().zip(Hasher::MDS).for_each(|(r, mds_row)| {
        state.iter().zip(mds_row).for_each(|(s, m)| {
            //*r += AB::Expr::from(m) * s;
        });
    });
    result
}

